(35, '2011-07-31 16:32:41', '2011-12-29 12:20:05', 'Clone of Mexican Cruise', 'Clone of 35% off 7 night Mexican cruise to Cancun ', '', '<p>The moment you reach your first stop on your cruise, you&rsquo;ll understand why it&rsquo;s one of our top favorites. With grand views of the surrounding area, you&rsquo;ll be immersed in culture, history and relaxing activities that will take your breath away. &nbsp;It&rsquo;s a great way to spend a vacation holiday with your significant other, away from the stress of work and everyday life. &nbsp;</p>\r\n<p>Your room is on the top level of the ship with it&rsquo;s own private balcony. Your accommodation also has AC, free wifi, laundry and a restaurant on the ground floor. &nbsp;They serve the best specialties dishes of the region. &nbsp;In fact, the chef insists that everyone try their local style cerviche.</p>\r\n<p>Enjoy the solitude or go out on the town, as the ship has everything you could imagine. &nbsp;You can stay out all night, dancing, eating, drinking and mingling with other passengers. &nbsp;There are multiple restaurants, bars, swimming pools, spas, theaters and dance halls. &nbsp;They even have a rock climbing gym to stay fit.</p>\r\n<p>If you have any additional requests or needs, your captain and crew encourage you to ask. &nbsp;They are more than happy to accommodate your group as needed. &nbsp;</p>', '<p>Package includes taxes and fees.</p>\r\n<p>Voucher cannot be applied towards previous reservations or groups.</p>\r\n<p>Normal property cancellation policies apply; voucher subject to forfeiture value.</p>\r\n<p>Sales are non-refundable, changes are subject to availability.</p>', '<ul>\r\n<li>Visit the best beaches of Mexico</li>\r\n<li>All food and drinks included</li>\r\n<li>Complementary room upgrade</li>\r\n<li>Free onboard internet connection</li>\r\n</ul>', 'With over 100 members staff members onboard your ship, you will be pampered in the best class service possible.\r\n', '<p>Plane</p>\r\n<p>The best way to get to your departure port is by flying into the Chiampano Airport located 45 miles away. &nbsp;Once landed you can take the 45 bus line which will stop within 500 feet from the ship&rsquo;s pier. &nbsp;You can also take a cab from the airport, which will cost around $30.</p>\r\n<p>Train</p>\r\n<p>You can also arrive by train. &nbsp;The closest stop is the Termini station. &nbsp;Once there, you can take a short cab ride. It should be less than $10. &nbsp;Just make sure you take a metered cab!</p>\r\n<p>Other</p>\r\n<p>Your host can also provide for a pickup from the train station or the airport. &nbsp;Call them directly and they&rsquo;ll be happy to make all the arrangements.</p>', '<div class="slide first_slide"><img src="http://demo.traveltipping.com/uploads/Image%202.jpg" alt="" />\r\n<div class="things_to_do_content">\r\n<p><strong> 1. Things To Do Number 1 </strong></p>\r\n<p>Lay on the whitest and cleanest beaches you&rsquo;ve ever seen. Relax, sleep and get a tan.</p>\r\n</div>\r\n</div>', '<div class="slide second_slide"><img src="http://demo.traveltipping.com/uploads/Image%203.jpg" alt="" />\r\n<div class="things_to_do_content">\r\n<p><strong> 1. Things To Do Number 2 </strong></p>\r\n<p>Visit this ancient temple, one of the most famous in the world. It&rsquo;s said that many people have been cured by the healing powers of the water here.</p>\r\n</div>\r\n</div>', '<div class="slide third_slide"><img src="http://demo.traveltipping.com/uploads/Image%201.jpg" alt="" />\r\n<div class="things_to_do_content">\r\n<p><strong> 1. Things To Do Number 3 </strong></p>\r\n<p>Hike to the top of this Elnis Mountain. You&rsquo;ll be rewarded with the most amazing views in the entire area and a beautiful sunset if you make the trek in the evening.</p>\r\n</div>\r\n</div>', '<div class="slide fourth_slide"><img src="http://demo.traveltipping.com/uploads/Image%204.jpg" alt="" />\r\n<div class="things_to_do_content">\r\n<p><strong> 1. Things To Do Number 4 </strong></p>\r\n<p>Want to taste the best seafood known to man? Try the Fresh Restaurant to appease your saltwater appetite. This restaurant is world renowned.</p>\r\n</div>\r\n</div>', '<div class="slide fifth_slide"><img src="http://demo.traveltipping.com/uploads/Image%207.jpg" alt="" />\r\n<div class="things_to_do_content">\r\n<p><strong> 1. Things To Do Number 5 </strong></p>\r\n<p>This small village, located only five miles for you, has a fantastic open festival every Friday night. There&rsquo;s live music, dancing. It''s one of the best night scenes around.</p>\r\n</div>\r\n</div>', 'Cancun', 1000.00, 650.00, '2011-07-16', '2012-07-31', '2011-09-02', '2011-09-24', 1, 45, 5, 12, NULL, 15.00, '', 14, 'http://demo.traveltipping.com/uploads/Beach%20View.jpg', 'http://demo.traveltipping.com/uploads/Greece.jpg', 'http://demo.traveltipping.com/uploads/Lodge.jpg', 'http://demo.traveltipping.com/uploads/Santorini.jpg', 'http://demo.traveltipping.com/uploads/Beach.jpg', 'http://demo.traveltipping.com/uploads/Venice.jpg', 4, 1, 2),
(36, '2011-07-31 20:28:08', '2011-11-03 14:54:27', 'Clone of Hotel in Peru', 'Clone of 50% off 4 night stay in Peru ', '', '<p>The moment you reach this hotel, you&rsquo;ll understand why it&rsquo;s one of our top favorites. &nbsp; With grand views of the surrounding area, you&rsquo;ll be immersed in culture, history and relaxing activities that will take your breath away. &nbsp;It&rsquo;s a great way to spend a vacation holiday with your significant other, away from the stress of work and everyday life. &nbsp;</p>\r\n<p>Your room is on the top floor with it&rsquo;s own private balcony. Your accommodation also has AC, free wifi, free parking, plenty of outdoor gear for roaming the countryside, laundry and a restaurant on the ground floor. &nbsp;They serve the best specialties dishes of the region. &nbsp;In fact, your host insists that everyone try their local style cerviche, the best in town.</p>\r\n<p>Enjoy the solitude or go out on the town, as your host is situated only a short walk from the city center. &nbsp;You can stay out all night, dancing, eating, drinking and mingling with friendly locals. &nbsp;It&rsquo; also well situated between two public transit stops for those taking public transportation. &nbsp;You&rsquo;ll find a grocery store two blocks away and the beach one step from your room.</p>\r\n<p>If you have any additional requests or needs, your host encourages you to ask. &nbsp;They are more than happy to accommodate your group as needed. &nbsp;</p>', '<p>Package includes taxes and fees.</p>\r\n<p>Voucher cannot be applied towards previous reservations or groups.</p>\r\n<p>Normal property cancellation policies apply; voucher subject to forfeiture value.</p>\r\n<p>Sales are non-refundable, changes are subject to availability.</p>', '<ul>\r\n<li>Stay in one of the world&rsquo;s most ancient cities</li>\r\n<li>Complementary breakfast</li>\r\n<li>One walking tour of the city included</li>\r\n<li>Free museum passes for two</li>\r\n</ul>', '<p>This quaint hotel is owned and operated by the Figora family.<span style="mso-spacerun: yes;">&nbsp; </span>If you need to make any special requests, they&rsquo;ll be happy to help!</p>', '<p>Plane</p>\r\n<p>The best way to get to your destination is by flying into the Chiampano Airport located 45 miles away. &nbsp;Once landed you can take the 45 bus line which will stop within 500 feet from where you&rsquo;re staying. &nbsp;You can also take a cab from the airport, which will cost around $30.</p>\r\n<p>&nbsp;</p>\r\n<p>Train</p>\r\n<p>You can also arrive by train. &nbsp;The closest stop is the Termini station. &nbsp;Once there, you can take a short cab ride. It should be less than $10. &nbsp;Just make sure you take a metered cab!</p>\r\n<p>&nbsp;</p>\r\n<p>Other</p>\r\n<p>Your host can also provide for a pickup from the train station or the airport. &nbsp;You can also rent a car, which will run about $50 a day &ndash; more if you want to get better insurance coverage.</p>', '<div class="slide first_slide"><img src="http://demo.traveltipping.com/uploads/Image%202.jpg" alt="" />\r\n<div class="things_to_do_content">\r\n<p><strong> 1. Things To Do Number 1 </strong></p>\r\n<p>Visit this ancient temple, one of the most famous in the world. It''s said that many people have been cured by the healing powers of the water here.</p>\r\n</div>\r\n</div>', '<div class="slide second_slide"><img src="http://demo.traveltipping.com/uploads/Image%203.jpg" alt="" />\r\n<div class="things_to_do_content">\r\n<p><strong> 2. Things To Do Number 2 </strong></p>\r\n<p>Hike to the top of this Elnis Mountain. You''ll be rewarded with the most amazing views in the entire area and a beautiful sunset if you make the trek in the evening.</p>\r\n</div>\r\n</div>', '<div class="slide third_slide"><img src="http://demo.traveltipping.com/uploads/Image%201.jpg" alt="" />\r\n<div class="things_to_do_content">\r\n<p><strong> 3. Things To Do Number 3 </strong></p>\r\n<p>Want to taste the best seafood known to man? Try the Fresh Restaurant to appease your saltwater appetite. This restaurant is world renowned.</p>\r\n</div>\r\n</div>', '<div class="slide fourth_slide"><img src="http://demo.traveltipping.com/uploads/Image%204.jpg" alt="" />\r\n<div class="things_to_do_content">\r\n<p><strong> 4. Things To Do Number 4 </strong></p>\r\n<p>This small village, located only five miles for you, has a fantastic open festival every Friday night. There''s live music, dancing. It''s one of the best night scenes around.</p>\r\n</div>\r\n</div>', '<div class="slide fifth_slide"><img src="http://demo.traveltipping.com/uploads/Image%207.jpg" alt="" />\r\n<div class="things_to_do_content">\r\n<p><strong> 5. Things To Do Number 5 </strong></p>\r\n<p>Visit the world''s largest petrified wood forest. You''ll find an entire groove of petrified trees dating back from the time dinosaurs roamed the earth.</p>\r\n</div>\r\n</div>', 'Peru', 520.00, 260.00, '2011-07-31', '2011-09-12', '2011-09-27', '2011-12-31', 0, 9, 5, 0, NULL, 15.00, '', 0, 'http://demo.traveltipping.com/uploads/Greece.jpg', 'http://demo.traveltipping.com/uploads/Beach%20View.jpg', 'http://demo.traveltipping.com/uploads/Lodge.jpg', 'http://demo.traveltipping.com/uploads/Beach.jpg', 'http://demo.traveltipping.com/uploads/Tuscany.jpg', 'http://demo.traveltipping.com/uploads/Woman%20on%20the%20Beach.jpg', 5, 2, 3),
